import Link from "next/link";
///import fetch from "isomorphic-unfetch";
function Index(props) {
  const { text } = props;
  return (
    <>
      <h1>Test</h1>
      <Link href="/about">
        <h1>Response: {text}</h1>
        <a>Go to About!</a>
      </Link>
    </>
  );
}

Index.getInitialProps = function() {
  // const text = fetch("./api/test.js").then(res => res.text());
  return { text: 1 };
};

export default Index;
